Antradienio vakarą  Ugnius Kiguolis  feisbuke paviešino ironijos kupiną įrašą, kuriame papasakojo, jog ne tik vyrai priekabiauja prie moterų. Būna ir atvirkščiai. „Prisipažinsiu ir aš. Atėjo laikas, – feisbuke rašė Ugnius, savo įrašą pažymėjęs grotažyme „mee too“. – Pastoviai tai patiriu, pastoviai tenka susidurti. Dar laukiniais  popsuchos  laikais, koncertų ir renginių metu, reikėdavo pasirašinėti ant nuogų papų, mėgautis girtų fanių draugijomis, dažnokai tiesiog bėgti iki viešbučio, kad nepapulčiau į sijonuotų zombių rankas.“ Pramogų pasaulio vilku arba tiesiog milijonieriumi iš  Kauno  pristatomas vyras pridūrė, jog jis toks ne vienas. „Dažnai klubuose tą patiriu ir dabar, turiu dantis sukandęs kentėti tiek plekšnojimus per užpakalį, tiek kabinimąsi į rankas, glostymus, tiek erzinančius botoksinius žvilgsnius, – rašė U. Kiguolis. – Esu tikras, kad toks esu ne vienas. Pagaliau atsiverkime, išsišnekėkime, junkimės prie bendro tikslo ir visiems laikams užkirskime kelią tokiai netvarkai.“ Baigęs įrašą Ugnius šį „iššūkį“ perdavė trims savo draugams: Deivydui Zvonkui, Jonui Nainiui bei Mantui Bžeskui. „Siunčiu trims draugams, kurie taip pat, jūsų žinioms, patyrė niekšišką kominių lupyčių seksualinį priekabiavimą ir išnaudojimą“, – feisbuke rašė Ugnius. Toks ironiškas Ugniaus pareiškimas feisbuke sulaukė ir teigiamų reakcijų, ir kritikos. Esą savo ironija jis sumenkina per pasaulį vilnijančios problemos viešinimo būtinybę. Tiesa, palaikantys tokį įrašą sveikino, jog Ugnius prabilo ir apie kitą šios problemos pusę – moterų seksualinį priekabiavimą prie vyrų. (function(d, s, i, r) {
